import React from 'react';

import styles from './Input.module.css';

const Input = (props) => {
  return (
    <div className={styles.input}>
      <label htmlFor={props.form.id}>{props.formLabel}</label>
      <input {...props.form} />
    </div>
  );
};

export default Input;
